<!DOCTYPE html>
<html dir="$i18n{textdirection}" lang="$i18n{language}">
  <head>
    <meta charset="utf-8" />
    <meta name="color-scheme" content="light dark" />
    <meta name="theme-color" content="#fff" />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1.0,
      maximum-scale=1.0, user-scalable=no"
    />
    <title>Chrome Dino</title>
    
    <script src="/DinoRunner/offline.js"></script>
    
    
    
    <script type="module" crossorigin src="/DinoRunner/assets/index.f02ae65c.js"></script>
    <link rel="stylesheet" href="/DinoRunner/assets/index.efdae926.css">
  </head>
  <body id="t" class="neterror">
    <div id="main-frame-error" class="interstitial-wrapper">
      <div id="main-content">
        <div class="icon"></div>
        <div id="main-message">
          <h1>
            <span jsselect="heading" jsvalues=".innerHTML:msg"></span>
            <a
              id="error-information-button"
              class="hidden"
              onclick="toggleErrorInformationPopup();"
            ></a>
          </h1>
          <p jsselect="summary" jsvalues=".innerHTML:msg"></p>
          <!--The suggestion list and error code are normally presented inline,
          in which case error-information-popup-* divs have no effect. When
          error-information-popup-container has the use-popup-container class, this
          information is provided in a popup instead.-->
          <div id="error-information-popup-container">
            <div id="error-information-popup">
              <div id="error-information-popup-box">
                <div id="error-information-popup-content">
                  <div
                    id="suggestions-list"
                    style="display: none"
                    jsdisplay="(suggestionsSummaryList && suggestionsSummaryList.length)"
                  >
                    <p jsvalues=".innerHTML:suggestionsSummaryListHeader"></p>
                    <ul
                      jsvalues=".className:suggestionsSummaryList.length == 1 ? 'single-suggestion' : ''"
                    >
                      <li
                        jsselect="suggestionsSummaryList"
                        jsvalues=".innerHTML:summary"
                      ></li>
                    </ul>
                  </div>
                  <div class="error-code" jscontent="errorCode"></div>
                  <p id="error-information-popup-close">
                    <a
                      class="link-button"
                      jscontent="closeDescriptionPopup"
                      onclick="toggleErrorInformationPopup();"
                    ></a>
                  </p>
                </div>
              </div>
            </div>
          </div>
          <div id="download-links-wrapper" class="hidden">
            <div id="download-link-wrapper">
              <a
                id="download-link"
                class="link-button"
                onclick="downloadButtonClick()"
                jsselect="downloadButton"
                jscontent="msg"
                jsvalues=".disabledText:disabledMsg"
              >
              </a>
            </div>
            <div id="download-link-clicked-wrapper" class="hidden">
              <div
                id="download-link-clicked"
                class="link-button"
                jsselect="downloadButton"
                jscontent="disabledMsg"
              ></div>
            </div>
          </div>
          <div id="save-page-for-later-button" class="hidden">
            <a
              class="link-button"
              onclick="savePageLaterClick()"
              jsselect="savePageLater"
              jscontent="savePageMsg"
            >
            </a>
          </div>
          <div
            id="cancel-save-page-button"
            class="hidden"
            onclick="cancelSavePageClick()"
            jsselect="savePageLater"
            jsvalues=".innerHTML:cancelMsg"
          ></div>
          <div id="offline-content-list" class="list-hidden" hidden>
            <div
              id="offline-content-list-visibility-card"
              onclick="toggleOfflineContentListVisibility(true)"
            >
              <div
                id="offline-content-list-title"
                jsselect="offlineContentList"
                jscontent="title"
              ></div>
              <div>
                <div
                  id="offline-content-list-show-text"
                  jsselect="offlineContentList"
                  jscontent="showText"
                ></div>
                <div
                  id="offline-content-list-hide-text"
                  jsselect="offlineContentList"
                  jscontent="hideText"
                ></div>
              </div>
            </div>
            <div id="offline-content-suggestions"></div>
            <div id="offline-content-list-action">
              <a
                class="link-button"
                onclick="launchDownloadsPage()"
                jsselect="offlineContentList"
                jscontent="actionText"
              >
              </a>
            </div>
          </div>
        </div>
      </div>

      <div id="details" class="hidden">
        <div class="suggestions" jsselect="suggestionsDetails">
          <div class="suggestion-header" jsvalues=".innerHTML:header"></div>
          <div class="suggestion-body" jsvalues=".innerHTML:body"></div>
        </div>
      </div>
    </div>
    <div id="sub-frame-error">
      <!-- Show details when hovering over the icon, in case the details are
         hidden because they're too large. -->
      <div class="icon"></div>
      <div
        id="sub-frame-error-details"
        jsselect="summary"
        jsvalues=".innerHTML:msg"
      ></div>
    </div>
